function loadStudentData(){let e=[],t=$("#studentNo").text();return $.ajax({type:"GET",url:"http://localhost:3000/api/Grade?filter=%7B%22where%22%3A%7B%22student%22%3A%22resource%3Aie.cit.blockchain.participant.Student%23"+t+"%22%7D%7D",success:t=>{t.forEach(t=>{let a={};a.gradeId=t.gradeId,a.finalGrade=t.finalGrade,a.crn=t.crn,a.subject=t.moduleCode.substring(0,4),a.course=t.moduleCode.substring(4),a.stage=t.stage,a.semester=t.semester,a.title=t.courseTitle,a.creditsEarned=t.creditsEarned,e.push(a)})}}).done(()=>{$("#studentGradesTable").DataTable({data:e,columns:[{data:"gradeId"},{data:"stage"},{data:"semester"},{data:"crn"},{data:"subject"},{data:"course"},{data:"title"},{data:"creditsEarned"},{data:"finalGrade"}]})}),e}$(()=>{if($("body").is(".student")){loadStudentData()}});